from collections import namedtuple
from images.models import Image
from images.serializers import ImageSerializer

if Image.objects.count() == 0:
    Request = namedtuple('Request', ['query_params'])
    img_one = ImageSerializer(
        data={
            'image': 'data:image/jpeg;base64,',
        },
        context={
            'request': Request(query_params={'format': 'internal'})
        }
    )
    if img_one.is_valid():
        img_one.save()
    img_two = ImageSerializer(
        data={
            'image': 'data:image/jpeg;base64,',
            'annotation': {
                'labels': [
                    {
                        'meta': {
                            'confirmed': False,
                            'confidence_percent': 0.0
                        },
                        'class_id': 'tooth',
                        'surface': [
                            'B',
                            'O',
                            'L'
                        ],
                        'shape': {
                            "endX": 0,
                            "endY": 1,
                            "startX": 2,
                            "startY": 3,
                        }
                    },
                    {
                        'meta': {
                            'confirmed': True,
                            'confidence_percent': 0.99
                        },
                        'class_id': 'gum',
                        'surface': [
                            'G',
                            'U',
                            'M'
                        ],
                        'shape': {
                            "endX": 3,
                            "endY": 2,
                            "startX": 1,
                            "startY": 0,
                        }
                    },
                ]
            }
        },
        context={
            'request': Request(query_params={'format': 'internal'})
        }
    )
    if img_two.is_valid():
        img_two.save()
